import React, { Component } from 'react'
import { Button } from '@material-ui/core'

export default class Classcomp extends Component {

    constructor(props) {
        super(props)
        this.state = {
             count : 0
        }
    }

    render() {
        const count=this.state
        return (
            <div>
                <button onClick={()=>count+1}>clicked {count}</button>
            </div>
        )
    }
}
